class Solution(object):
    def maxJump(self, stones):
        """
        :type stones: List[int]
        :rtype: int
        """
        ls = SortedList([])
        
        cnt =1 
        @cache
        def dfs(idx,mid):
            nonlocal cnt
            #print(cnt,idx)
            cnt +=1
            #print(idx,mid,ls,l,r)
            if idx >= stones[-1]:
                return True
            left = ls.bisect_left(idx+0.1)
            kt = ls.bisect_right(idx + mid+0.1)
            #print(left,kt)
            for j in range(left,kt):
                #print(j,left,kt,ls, idx,idx+mid)
                if j >= len(ls)-1:
                   #print("vvv",j,len(ls),left,kt,ls,idx,mid)
                    return True
                if ls[j+1]-ls[j-1] > mid: continue
                t = ls[j]
                #ls.remove(ls[j])
                #print(t,j,ls)
                if dfs(t,mid): return True
                #ls.add(ls[j])
            return False
        l,r = 0, stones[-1]
        while l < r:
            mid = (l+r) >>1
            ls = SortedList([])
            for a in stones:
                ls.add(a)
            if not dfs(0,mid):
                #print(mid,False)
                l= mid +1 
            else:
                #print(mid,True)
                r = mid
        return l
            
            
            




